function setMap() {
    var minimal = L.tileLayer(
            'http://{s}.tiles.mapbox.com/v3/rudyohead.35b6fe76/{z}/{x}/{y}.png', {
                attribution: "<h8>Mapbox. 2015.</h8>"
            }),
        dark = L.tileLayer(
            'https://a.tiles.mapbox.com/v3/rudyohead.hf2di141/{z}/{x}/{y}.png', {
                attribution: "<h8>Mapbox. 2015.</h8>"
            }),
			
		light = L.tileLayer(
            'http://{s}.basemaps.cartocdn.com/light_nolabels/{z}/{x}/{y}.png', {
                attribution: "<h8>&copy; <a href='http://www.openstreetmap.org/copyright'>OpenStreetMap</a> contributors, &copy; <a href='http://cartodb.com/attributions'>CartoDB</a></h8>"
            }),
			
        labels = L.tileLayer(
            'http://{s}.tile.stamen.com/toner-labels/{z}/{x}/{y}.png', {
               attribution: "<h8>Map tiles by <a href='http://stamen.com'>Stamen Design</a>, under <a href='http://creativecommons.org/licenses/by/3.0'>CC BY 3.0</a>. Data by <a href='http://openstreetmap.org'>OpenStreetMap</a>, under <a href='http://www.openstreetmap.org/copyright'>ODbL</a>.</h8>"
            });
			
    var baseMaps = {
        "Default": dark,
        "Green": minimal,
		"Light": light,
    };
    var overlayMaps = {
        "Labels": labels,
    };
	
	var southWest = L.latLng(44.220167, -121.238693),
		northEast = L.latLng(44.308923, -121.119217),
        bounds = L.latLngBounds(southWest, northEast);
	
    map = L.map('map', {
        center: new L.LatLng(44.266144, -121.173846),
        zoom: 13,
		minZoom: 12,
		maxZoom: 20,
		zoomControl: true,
		measureControl: true,
        layers: [dark],
		maxBounds: bounds
    });
	
    L.control.layers(baseMaps, overlayMaps).addTo(map);
    
    geoJson = L.geoJson(statesData,{style: style8, onEachFeature: onEachFeatureTotal});
	
	map.addLayer(geoJson);
	
	processCSV();
	
};

function processCSV() {
    var processCSV = new ProcessCSV();
    var csv = 'data/csvData.csv';
    processCSV.addListener("complete", function() {
        csvData = processCSV.getCSV();
        createMarkers();
    });
    processCSV.process(csv);
};


function createMarkers() {
    var markerStyle = {
        color:'#008080',
        fillColor: '#20B2AA',
		weight: 0.5,
        fillOpacity: 0.8,
    };
    var markersArray = [];
    for (var i = 0; i < csvData.length; i++) {
        var feature = {};
        feature.properties = csvData[i];
        var lat = Number(feature.properties.X);
        var lng = Number(feature.properties.Y);
        var marker = L.circleMarker([lat, lng], markerStyle);
        marker.feature = feature;
        markersArray.push(marker);
    };
    markersLayer = L.featureGroup(markersArray);
    markersLayer.addTo(map);
    radiusArray = [];
    markersLayer.eachLayer(function(layer) {
        var radius = onEachFeature(layer); //->
        radiusArray.push(radius);
    });
    markersLayer.addTo(map);
};

function resetLayers() {
    map.removeLayer(markersLayer);
    map.addLayer(markersLayer);
}


function onEachFeature(layer) {
	 
    if (layer.feature.properties.type == 'Education' && eduLayer == true) {
        layer.setRadius(radius);
    } else {
        if (layer.feature.properties.type != 'Education' && eduLayer == true) {
            map.removeLayer(layer);
        }
    }
    if (layer.feature.properties.type == 'Facilities' && facLayer == true) {
        layer.setRadius(radius);
    } else {
        if (layer.feature.properties.type != 'Facilities' && facLayer == true) {
            map.removeLayer(layer);
        }
    }
    if (layer.feature.properties.type == 'FireStation' && fireLayer == true) {
        layer.setRadius(radius);
    } else {
        if (layer.feature.properties.type != 'FireStation' && fireLayer == true) {
            map.removeLayer(layer);
        }
    }
    if (layer.feature.properties.type == 'Hospital' && hospLayer == true) {
        layer.setRadius(radius);
    } else {
        if (layer.feature.properties.type != 'Hospital' && hospLayer == true) {
            map.removeLayer(layer);
        }
    }
    if (layer.feature.properties.type == 'PoliceStation' && policeLayer == true) {
        layer.setRadius(radius);
    } else {
        if (layer.feature.properties.type != 'PoliceStation' && policeLayer == true) {
            map.removeLayer(layer);
        }
    }
    if (layer.feature.properties.type == 'Recreation' && recLayer == true) {
        layer.setRadius(radius);
    } else {
        if (layer.feature.properties.type != 'Recreation' && recLayer == true) {
            map.removeLayer(layer);
        }
    }

    var area = layer.feature.properties[timestamp] * scaleFactor;
    var radius = Math.sqrt(area / Math.PI);
    layer.setRadius(radius);
    var popupHTML = layer.feature.properties.name;
    layer.bindPopup(popupHTML, {
        offset: new L.Point(0, -radius)
    });
    layer.on({
        mouseover: function() {
            layer.openPopup();
            this.setStyle({
                radius: radius,
				color: '#008080',
				fillColor: '#00FFFF',
				weight: 0.5,
				fillOpacity: 1.0,
            });
        },
        mouseout: function() {
            this.setStyle({
                color: '#008080',
				fillColor: '#20B2AA',
				weight: 0.5,
				fillOpacity: 0.8,
            });
        }
    });
    return radius;
};

function updateLayers() {
    var radiusArray = [];
    markersLayer.eachLayer(function(layer) {
        var r = onEachFeature(layer);
        radiusArray.push(r);
    });
}

function highlightFeature(e) {
    var layer = e.target;
	
    layer.setStyle({
        weight: 5,
		opacity: 0.9,
        color: 'yellow',
        dashArray: '',
        fillOpacity: opacity
    });

    if (!L.Browser.ie && !L.Browser.opera) {
        layer.bringToFront();
    }
	
	 info.update(layer.feature.properties);
}

function resetHighlight(e) {
    geoJson.resetStyle(e.target);
	info.update();
}

