function getColor(d) {
    return d == 10 ? '#450005' :
           d == 9  ? '#800026' :
           d == 8  ? '#bd0026' :
           d == 7  ? '#e31a1c' :
           d == 6   ? '#fc4e2a' :
           d == 5  ? '#fd8d3c' :
           d == 4   ? '#feb24c' :
		   d == 3   ? '#fed976' :
		   d == 2   ? '#ffeda0' :
		   d == 1   ? '#ffffcc' :
		   d == 0   ? '#ffffff' :
                      '#000000';
}

